import React from 'react';
import { Typography, Paper } from '@mui/material';
import StorefrontOutlinedIcon from '@mui/icons-material/StorefrontOutlined';

const styles = {
    container: {
      padding: '2rem',
      display: 'flex',
      justifyContent: 'center',
    },
    mainPaper: {
      position: 'relative', // Add relative positioning to the main Paper
      width: '50%',
      backgroundColor: '#325636',
      padding: '2rem', // Add padding to the main Paper
      display: 'flex',
      flexDirection: 'column',
    },
    textContainer: {
      display: 'flex', // Set display to flex
      alignItems: 'center', // Align items vertically
      marginTop: '1rem', // Add margin to create space between text and icon
    },
    text: {
      fontWeight: 'bold',
      color: '#FFFFFF',
      textAlign: 'left',
      margin: '0 0.5rem', // Adjust margin for text
    },
    icon: {
      color: '#FFFFFF',
    },
  };
  
  const PickupPage = () => {
    return (
      <div style={styles.container}>
        <Paper elevation={3} sx={styles.mainPaper}>
          <Typography variant='h6' style={styles.text}>Store details</Typography>
          <div style={styles.textContainer}>
            <StorefrontOutlinedIcon style={styles.icon} />
            <Typography style={styles.text}>Relaxing Koala</Typography>
          </div>
        </Paper>
      </div>
    );
  };
  
  export default PickupPage;
